import { Link } from "react-router-dom";

const Sidebar: React.FC = () => {
  return (
    <div>
      <Link to={"/"}>
        <div>
          <p>Dashboard</p>
        </div>
      </Link>

      <Link to={"/products"}>
        <div>
          <p>Products</p>
        </div>
      </Link>

      <Link to={"/addProduct"}>
        <div>
          <p>Add Product</p>
        </div>
      </Link>
    </div>
  );
};

export default Sidebar;
